// Enemy Territory - http://www.splashdamage.com/
____________________________________

Browse to the ET folder and open the ET.exe to start Enemy Territory.

In case you are playing Enemy Territory for the first time take a look at the useful_links.txt


____________________________________

// TZAC AntiCheat by Tomislav Zubcic - http://tz-ac.com/
